import logo from './logo.svg';
import './App.css';
import {getRestInformation} from "./Components/YelpAPI";
import {GeoLocation} from "./Components/GeoLocation";

function App() {
  // Dummy function call to get the closest restaurant from Myles Standish Hall
  let ans = getRestInformation('610 Beacon Street, Boston, MA 02215', [1,2,3,4])
  console.log(ans)
  let myLocation = new GeoLocation()
  myLocation.componentDidMount()
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
